<style>
@keyframes h2 {
   0% {transform: rotateY( -50deg);}
  50% {transform: rotateY(  50deg);}
 100% {transform: rotateY( -50deg);}}
@keyframes h4 {
   0% {transform: rotateY(  80deg);}
  50% {transform: rotateY( -20deg);}
 100% {transform: rotateY(  80deg);}}
@keyframes h6 {
   0% {transform: rotateY(  -5deg);}
  50% {transform: rotateY(-105deg);}
 100% {transform: rotateY(  -5deg);}}
@keyframes h1 {
   0% {transform: rotateY( -90deg);}
  50% {transform: rotateY(  10deg);}
 100% {transform: rotateY( -90deg);}}
@keyframes h3 {
   0% {transform: rotateY(  10deg);}
  50% {transform: rotateY( 110deg);}
 100% {transform: rotateY(  10deg);}}
@keyframes h5 {
   0% {transform: rotateY(  60deg);}
  50% {transform: rotateY( -40deg);}
 100% {transform: rotateY(  60deg);}}

@keyframes v {
   0% {transform: rotateX(   0deg);}
  25% {transform: rotateX(  45deg);}
  50% {transform: rotateX(   0deg);}
 100% {transform: rotateX(   0deg);}}

@keyframes s {
   0% {transform: translateX(0px);}
 100% {transform: translateX(-10000px);}
}

[role="root"][data-name="Hexapod"] {
  animation-name: s;
  animation-timing-function: linear;

}

[role="group"][data-name="legs"] [role="group"][data-name="lg-anim-wrapper"] {

}

[role="group"][data-name="2"] [role="group"][data-name="lg-anim-wrapper"] {

/*BEGIN Cuboid*
.cube .bottom,
.cube .top,
.cube .front,
.cube .back,
.cube .left,
.cube .right { transform-origin:0 0;background-color:var(--cuboid-color); }

.cube .bottom,
.cube .top,
.cube .front,
.cube .back { width:var(--cuboid-width); }
.cube .left,
.cube .right,
.cube .top,
.cube .bottom { height:var(--cuboid-depth); }
.cube .left,
.cube .right { width:var(--cuboid-height); }
.cube .front,
.cube .back { height:var(--cuboid-height); }

.cube .back  { transform:rotateX(90deg) }
.cube .front { transform:rotateX(90deg) translateZ(calc(-1 * var(--cuboid-depth))) }
.cube .left  { transform:rotateY(-90deg) }
.cube .right { transform:rotateY(90deg) translate3d(calc(-1 * var(--cuboid-height)),0,var(--cuboid-width)) }
.cube .top   { transform:translateZ(var(--cuboid-height)) }

.cube .bottom:before,
.cube .top:before,
.cube .front:before,
.cube .back:before,
.cube .left:before,
.cube .right:before { content:'';position:absolute;top:0;right:0;bottom:0;left:0; }
.cube .back:before { background-color:rgba(0,0,0,.4); }
.cube .bottom:before { background-color:rgba(0,0,0,.5); }
.cube .front:before { background-color:rgba(0,0,0,.1); }
.cube .left:before { background-color:rgba(0,0,0,.2); }
.cube .right:before { background-color:rgba(0,0,0,.3); }
/*END*/
